import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import { Option } from './Option';
import { FaArrowAltCircleDown, FaArrowAltCircleUp, FaList, FaCut } from 'react-icons/fa';
import axios from 'axios';

export const Navbar = () => {
    const [isHovered, setIsHovered] = useState(false);
    const [isSignUpHovered, setIsSignUpHovered] = useState(false);
    const [isClicked, setIsClicked] = useState(false);
    const [requestOrderData, setRequestOrderData] = useState([]);

    const handleMouseEnter = () => setIsHovered(true);
    const handleMouseLeave = () => setIsHovered(false);
    const handleMouseEnterSignUp = () => setIsSignUpHovered(true);
    const handleMouseLeaveSignUp = () => setIsSignUpHovered(false);
    const handleClick = () => setIsClicked(prevState => !prevState);

    useEffect(() => {
        const fetchRequestData = async () => {
            try {
                const supplierId = localStorage.getItem('supplierId');
                if (supplierId) {
                    const response = await axios.get(`http://localhost:9093/bookingdata/getorderbooking?supplierid=${supplierId}`);
                    if (response.status === 200) {
                        setRequestOrderData(response.data);
                    } else {
                        console.error("API did not respond as expected");
                    }
                } else {
                    console.warn("Supplier ID not found in localStorage");
                }
            } catch (error) {
                console.error("Error fetching request data:", error);
            }
        };

        fetchRequestData();
    }, []);

    return (
        <div>
            <div id='header'>
                <div id='logo-icon'>
                    <button onClick={handleClick}>
                        {isClicked ? <FaCut /> : <FaList />}
                    </button>
                    {isClicked && <Option />}
                </div>
                <div id='name'>
                    <h2>WELCOME RIDE-RENTAL</h2>
                </div>
                <div>
                    <Link to="/login">
                        <button
                            id='loginbutton'
                            onMouseEnter={handleMouseEnter}
                            onMouseLeave={handleMouseLeave}
                            aria-label="Login button"
                        >
                            Login
                            {isHovered ? (
                                <FaArrowAltCircleUp id="icon" />
                            ) : (
                                <FaArrowAltCircleDown id="icon" />
                            )}
                        </button>
                    </Link>
                </div>
                <div>
                    <Link to="/signup">
                        <button
                            id='signupbutton'
                            onMouseEnter={handleMouseEnterSignUp}
                            onMouseLeave={handleMouseLeaveSignUp}
                            aria-label="Signup button"
                        >
                            Signup
                            {isSignUpHovered ? (
                                <FaArrowAltCircleUp id="icon" />
                            ) : (
                                <FaArrowAltCircleDown id="icon" />
                            )}
                        </button>
                    </Link>
                </div>
            </div>
            <div>
                <h2>Booking Request</h2>
                <div>
                    {requestOrderData.length > 0 ? (
                        requestOrderData.map(order => (
                            <div key={order.id}>{order.username}</div>
                        ))
                    ) : (
                        <p>No booking requests found.</p>
                    )}
                </div>
            </div>
        </div>
    );
};
